(12, '9377', 'Avvisi di esami capitaneria di porto', 10, 5, 7, '2015-03-17 13:52:04', '2015-05-19 12:52:04', 4, 1, 0, 0, 1, NULL, NULL, 1, 'Capitaneria di porto', '', '9377', '2015-01-30', '2015-02-12 00:00:00', '2015-11-10 00:00:00', 1, 0, 1, '', 6, '<p>Avvisodi esami per il conseguimento del certificato "Marittimo abilitato ai mezzi di salvataggio" e di "marittimo abilitato ai battelli di emergenza veloci"</p>\n<p></p>', 13, 0),
(13, '10119', 'Avviso Costituzione Comitato Comunale Pari Opportunit', 10, 5, 7, '2015-03-17 14:08:45', '2015-05-19 12:51:51', 2, 1, 0, 0, 1, NULL, NULL, 1, '', '', '10119', '2015-02-17', '2015-02-17 00:00:00', '2015-05-29 00:00:00', 1, 0, 1, '', 6, '<p>Costituzione Comitato Comunale Pari Opportunit</p>', 1, 0),
(14, '13846', 'Avviso di sospensione gara Cappella S. Francesco e Orazione e Morte', 10, 5, 7, '2015-03-17 15:11:40', '2015-05-19 12:51:38', 2, 1, 0, 0, 1, NULL, NULL, 1, '', '', '13846', '2015-03-05', '2015-03-09 00:00:00', '2015-04-14 00:00:00', 1, 0, 1, '', 6, '<p>Affidamento tramite concessione di lavori pubblici della progettazione definitiva ed esecutiva, ricostruzione e gestione economico-funzionale della cappella cimiteriale di S. Francesco d''Assisi, nonch progettazione definitiva ed esecutiva e lavori di restauro e risanamento conservativo della cappella cimiteriale "Orazione e Morte" nel Cimitero di Via Garibaldi. - CIG 611279994E</p>', 1, 0),
(15, '14283', 'Pubblicazione Graduatoria', 10, 5, 7, '2015-03-17 15:16:13', '2015-05-19 12:51:24', 4, 1, 0, 0, 1, NULL, NULL, 1, '', '', '14283', '2015-03-09', '2015-03-10 00:00:00', '2015-04-10 00:00:00', 1, 0, 1, '', 6, '<p>Graduatoria finale selezione per n.4 posti progetto di servizio civile: osservando Gaeta 3  Reti solidali</p>', 1, 0),
(16, '14571', 'Decreto N 43/2015 autorita portuale', 10, 5, 7, '2015-03-17 15:25:28', '2015-05-19 12:51:11', 4, 1, 0, 0, 1, NULL, NULL, 1, '', 'Autorit portuale Civitavecchia Fiumicino Gaeta', '14571', '2015-02-20', '2015-03-10 00:00:00', '2015-04-09 00:00:00', 1, 0, 1, '', 6, '<p>Regolamento per la disciplina della sosta temporanea delle merci del porto commerciale di gaeta</p>', 9, 0),
(17, '14559', 'Decreto n.51 Autorita portuale', 10, 5, 7, '2015-03-17 15:30:17', '2015-05-19 12:50:59', 4, 1, 0, 0, 1, NULL, NULL, 1, '', 'Autorit portuale Civitavecchia Fiumicino Gaeta', '14559', '2015-03-06', '2015-03-10 00:00:00', '2015-03-09 00:00:00', 1, 0, 1, '', 6, '<p>Aree demaniali marittime destinate ad area di cantiere per l''esecuzione dei lavori denominati "opere di completamento del porto commerciale di Gaeta"</p>', 4, 0),
(18, 'Delibera Consiliare n 5', 'Regolamento per la gestione informatizzata atti e provvedimenti', 30, 5, 7, '2015-03-17 15:41:44', '2015-05-19 12:50:38', 2, 1, 0, 0, 1, NULL, NULL, 1, '', '', '5', '2015-01-28', '2015-03-10 00:00:00', '2015-04-09 00:00:00', 1, 0, 1, '', 6, '<p>Regolamento per la gestione informatizzata atti e provvedimenti</p>', 16, 0),
(20, '', 'Delibera giunta Matarazzo Maurizio', 20, 5, 7, '2015-03-18 09:53:31', '2015-05-19 12:50:16', 2, 1, 0, 0, 1, NULL, NULL, 1, '', '', '52', '2015-03-03', NULL, NULL, 1, 0, 1, '', 6, '<p>Costituzione in giudizio avverso il reclamo ex art. 669 terdecies c.p.c. avverso ordinanza del 26/11/2014 del Giudice del Lavoro resa nel giudizio ex art. 700 c.p.c. promosso dal Sig. Matarazzo Maurizio per scorrimento di graduatoria del concorso pubblico per Comandante di Polizia Locale. Conferimento incarico legale all''Avvocatura Comunale.</p>', 5, 0),
(26, '103', 'Delibera giunta Cosenz ex L.R. 42/97', 17, 5, 7, '2015-03-18 10:17:09', '2015-05-19 12:48:58', 12, 1, 0, 0, 1, NULL, NULL, 1, '', '', '103', '2016-06-26', '2016-06-26 00:00:00', NULL, 1, 0, 1, '', 6, '<p>Progetto per la sistemazione, il restauro e la ristrutturazione della ex Caserma Cosenz a Biblioteca comunale a Museo civico e attivit cultuali - Lavori urgenti per la stabilit opere di sostegno lato Via Angioina e per completamenti vari ed impianti. provvedimenti per richiesta finanziamenti ex L.R. n. 42/97</p>', 4, 0),
(27, '51', 'Delibera giunta Damiano Vellozzi', 17, 5, 7, '2015-03-18 10:19:30', '2015-05-19 12:48:48', 8, 1, 0, 0, 1, NULL, NULL, 1, '', '', '51', '2015-03-03', NULL, NULL, 1, 0, 1, '', 6, '<p>Costituzione in giudizio presso il Consiglio di Stato, avverso il ricorso proposto per l''annullamento della Sentenza n. 298/2013, emessa dal TAR Lazio, I Sez. staccata di Latina, nel giudizio iscritto alla R.R. n. 103/2004, con la quale  stato rigettato parzialmente il ricorso in relazione alla Determinazione paesistica prot.llo n. 34137 del 14/11/2003 concernente le opere oggetto delle istanze di condono n. 2391S, 638C e 639C site in localit Ariana.</p>', 5, 0),
(28, '49', 'Delib. giunta - Valerio Fantasia', 17, 5, 7, '2015-03-18 10:22:46', '2015-05-19 12:48:40', 8, 1, 0, 0, 1, NULL, NULL, 1, '', '', '49', '2015-03-03', NULL, NULL, 1, 0, 1, '', 6, '<p>Conferimento di incarico professionale all''Avvocatura Comunale per la costituzione in giudizio presso il consiglio di Stato, promosso dal Sig. Valerio Fantasia per l''annullamento e riforma della Sentenza TAR Lazio n. 980/2013 e per l''annullamento dell''Ord. N. 262/2005.</p>', 5, 0),
(29, '42', 'Delibera giunta- C.I.P.A.', 17, 5, 7, '2015-03-18 10:25:04', '2015-05-19 12:48:31', 6, 1, 0, 0, 1, NULL, NULL, 1, '', '', '42', '2015-02-18', NULL, NULL, 1, 0, 1, '', 6, '<p>Conferimento incarico professionale all''Avvocatura comunale per la costituzione nel giudizio di trasposizione promosso innanzi al TAR Lazio - Sezione di Latina in atti prot. 62409 del 18/12/2014.</p>', 4, 0),
(30, '08', 'Deliberazione consiliare 08 Approvazione Regolamento Biblioteca e Archivio Storico', 19, 5, 7, '2015-03-18 10:27:18', '2015-04-16 11:30:51', 3, 0, 0, 0, 0, NULL, NULL, 1, '', '', '', '2015-01-28', NULL, NULL, 1, 0, 1, '', 1, '<p><strong><span style="font-family:''Trebuchet MS'', ''sans-serif'';">Approvazione Regolamento dei Servizi Biblioteca e Archivio Storico del Comune di Gaeta.</span></strong></p>', 42, 0),
(32, '07', 'Deliberazione consiliare 07 Gestione associata servizi sociali distretto Formia-Gaeta', 19, 5, 7, '2015-03-18 10:31:24', '2015-05-19 12:48:21', 6, 1, 0, 0, 1, NULL, NULL, 1, '', '', '07', '2015-01-28', '2015-01-28 00:00:00', NULL, 1, 0, 1, '', 6, '<p><strong><span style="font-family:''Trebuchet MS'', ''sans-serif'';">Approvazione della convenzione ai sensi dell''art.30 del Decreto Legislativo n267/2000 per la gestione associata dei servizi sociali tra i Comuni di Formia, Gaeta, Minturno, Itri, Santi Cosma e Damiano, Castelforte, Spigno Saturnia, Ponza e Ventotene (Distretto Formia - Gaeta).</span></strong></p>', 17, 0),
(33, '06', 'Deliberazione consiliare 06 App.ne Reg.to trasparenza situazione patrimoniale eletti', 19, 5, 7, '2015-03-18 10:36:05', '2015-05-19 12:48:09', 6, 1, 0, 0, 1, NULL, NULL, 1, '', '', '06', '2015-01-28', '2015-01-28 00:00:00', NULL, 1, 0, 1, '', 6, '<p>Approvazione "regolamento per la pubblicita e la trasparenza della situazione patrimonialee reddituale dei componenti degli organi di indirizzo politico titolari di cariche elettive e di governo e relativo sistema sanzionatorio"</p>\n<p></p>', 34, 0),
